import './App.css';
import React, {Component} from 'react';
import HeaderSection from './components/HeaderSection';

class App extends Component {
  constructor() {
    super();
  }

  render(){
    return (
      <div className='App'>
        <HeaderSection />
        <form>
          <label htmlFor="firstNameInput" placeholder='First name'></label>
        </form>
      </div>
    );
  }
}
export default App;
